import { ImagenCartaFaqs} from './ImagenCartaFaqs'
import { Card } from 'react-bootstrap'

export const CartaFaqs = ({ data }) => {
  return (
      <Card className="cartaFaqs">
        <ImagenCartaFaqs /> 
        <h2 style={{ fontSize: "20px" }}>{data.title}</h2>
        <p>{data.description}</p>
      </Card>
  )
}
